import React, { useState, useEffect } from 'react';
const Portfolio = () => {
    const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });

    const getValues = () => {
        console.log('hi')
        alpha.data.intraday('msft').then(data => {
            return data;
        });
    }

    return (
        <div>
            Hi
            {getValues()}
        </div>
    );
}
 
export default Portfolio;
